	// Sticky nav
    function stickyNav() {
        var whiteNav = $('.super-header'),
			blueNav = $('.header-anchor'),
            winTop = win.scrollTop(),
            blueNavTop = blueNav.offset().top;
            whiteNavTop = whiteNav.offset().top;

        // if window top is greater than blue nav top, add sticky class
        if (winTop > blueNavTop) {
            $('.blue-header').addClass('sticky');
        } else {
            $('.blue-header').removeClass('sticky');
        }

		// if window top is greater than blue nav top, add sticky class
		if (winTop > whiteNavTop) {
			$('.logo-util').addClass('sticky');
		} else {
			$('.logo-util').removeClass('sticky');
		}

    }

